import { useSpring, animated } from 'react-spring'

export default function Index() {
  const props = useSpring({
    opacity: 1,
    from: {
      opacity: 0
    }
  })

  const data = useSpring({
    number: 100,
    from: {
      number: 0
    }
  })

  return (
    <div>
      <animated.div style={props}>{data.number}</animated.div>
    </div>
  )
}
